@mark2sell

You could please clarify what you've said.

You've said that your computer came with a pre-installed genuine Windows 7 Home Edition. But instead you've installed Windows 7 Pro, which is a cracked version and a pop-up message keeps telling that the windows you're using is not genuine. Is that what you're trying to say?

theLEAK's suggestion would be is to back-up your files using a single or double-layer disc. Reboot (format) your computer. It will now restore its default Windows Home Edition. After it completes rebooting and installed the default application, download this torrent again and copy and paste the serial. This is probably the best solution however the decision is yours.

